INSERT INTO catalog_product VALUES(1,'Тестовая Куртка','Очень классная куртка',1,1,'uploads/catalog/% Y/% m/% d/короткая_женск_черн0643.webp',1,0);
INSERT INTO catalog_product VALUES(2,'Тестовая куртка 2','"But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure?"',1,0,'uploads/catalog/istockphoto-136568907-612x612.jpg',1,0);
INSERT INTO catalog_product VALUES(3,'Тестовая куртка 3','"At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident, similique sunt in culpa qui officia deserunt mollitia animi, id est laborum et dolorum fuga. Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil impedit quo minus id quod maxime placeat facere possimus, omnis voluptas assumenda est, omnis dolor repellendus. Temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet ut et voluptates repudiandae sint et molestiae non recusandae. Itaque earum rerum hic tenetur a sapiente delectus, ut aut reiciendis voluptatibus maiores alias consequatur aut perferendis doloribus asperiores repellat."',1,0,'uploads/catalog/images_1.jpg',1,0);
INSERT INTO catalog_product VALUES(4,'Тестовое платье','"On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour, when our power of choice is untrammelled and when nothing prevents our being able to do what we like best, every pleasure is to be welcomed and every pain avoided. But in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pains."',1,0,'uploads/catalog/славная-модель-в-всходе-студии-26630677.webp',2,0);
INSERT INTO catalog_product VALUES(5,'Тестовое платье 2','"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum."',1,0,'uploads/catalog/istockphoto-492462644-612x612.jpg',2,0);
INSERT INTO catalog_product VALUES(6,'Рубашка ANTONELLI FIRENZE тестовая','Лаконичная белоснежная рубашка сможет найти общий язык с вещами как из повседневного, так и из офисного или нарядного гардероба, например, с черным костюмом для особого случая. Для пошива изделия с нагрудными накладными карманами и длинными рукавами мастера дома Antonelli Firenze использовали тонкий струящийся вискозный атлас. Переливающаяся гладкая ткань с нитям шелка в составе нежно скользит по коже и почти не ощущается на теле. Чтобы полуприталенная модель комфортнее садилась по фигуре, сзади предусмотрели бантовую складку.',0,0,'uploads/catalog/g4.jpg',2,57330);
INSERT INTO catalog_product VALUES(7,'Костюм из шерсти, шёлка и кашемира','Главный акцент в дизайне костюма благородного оттенка айвори сосредоточен на трикотаже. Для производства ткани использовался премиальный состав из смеси мягкой теплой шерсти и нежнейшего baby-кашемира, укрепленные волокнами шелка. Джемпер отличается удлиненной спинкой с боковыми разрезами и крупной вязкой по краям, а брюки - струящимся свободным силуэтом, сохраняющим простор движений.',0,0,'uploads/catalog/g2.jpg',2,101430);
